import React from "react";
import render from "react-dom/client";
import App from "./App";
import "./index.css";
const root = createRoot(container); // createRoot(container!) if you use TypeScript

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
